import React from "react";
import styled from "styled-components";
import {FaFilter} from "react-icons/fa";

const NavbarWrapper = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px 10px;
  width: 100%;
  height: 50px;
  background-color: #271815;
  color: #FFFFFF;
`;

const SearchBarWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #FFFFFF;
  width: 25%;
  height: 30px;
  border-radius: 2px;

  button {
    display: flex;
    justify-content: center;
    align-items: center;
    border: none;
    border-right: 1px solid #271815;
    height: 100%;
    padding: 5px 10px;
    font-size: 16px;
    cursor: pointer;
    background-color: transparent;
  }
  span {
    margin-left: 5px;
  }
`;

const SearchBar = () => (
    <SearchBarWrapper>
        <button>
            <FaFilter/>
            <span>Title</span>
        </button>
    </SearchBarWrapper>
);

const SearchFieldWrapper = styled.div`
  height: 100%;
  display: flex;
  padding: 5px 0;

`;

const SearchField = () => (
    <SearchFieldWrapper>

    </SearchFieldWrapper>
);

const Navbar = () => (
    <NavbarWrapper>
        <span>Logo</span>
        <SearchBar />
        <SearchField />
    </NavbarWrapper>
);

export default Navbar;
